"vs/platform/list/browser/listService":["Рабочее место","Соответствует клавише CTRL в Windows и Linux и клавише COMMAND в macOS.","Соответствует клавише ALT в Windows и Linux и клавише OPTION в macOS.",'Модификатор, который будет использоваться для добавления элементов в деревьях и списках в элемент множественного выбора с помощью мыши (например, в проводнике, в открытых редакторах и в представлении scm). "ctrlCmd" соответствует клавише CTRL в Windows и Linux и клавише COMMAND в macOS. Жесты мыши  "Открыть сбоку" (если они поддерживаются), будут изменены таким образом, чтобы они не конфликтовали с модификатором элемента множественного выбора.',"Открывает элемент одним щелчком мыши.","Открывает элемент двойным щелчком мыши.",'Управляет тем, как открывать элементы в деревьях и списках с помощью мыши (если поддерживается). Укажите значение "singleClick", чтобы открывать элементы одним щелчком мыши, и "doubleClick", чтобы открывать их только двойным щелчком мыши. Для родительских элементов с дочерними элементами в деревьях этот параметр управляет тем, будет ли родительский элемент разворачиваться по одинарному или по двойному щелчку мыши. Обратите внимание, что этот параметр может игнорироваться в некоторых деревьях и списках, если он не применяется к ним. ',"Определяет, поддерживают ли древа горизонтальную прокрутку в рабочей области."],
