"vs/workbench/services/themes/common/colorExtensionPoint":["Добавляет цвета тем, определяемые расширением ","Идентификатор цвета темы","Идентификаторы необходимо указывать в форме aa [.bb]*","Описание цвета темы","Цвет по умолчанию для светлых тем. Укажите значение цвета в шестнадцатеричном формате (#RRGGBB[AA]) или идентификатор цвета темы.","Цвет по умолчанию для темных тем. Укажите значение цвета в шестнадцатеричном формате (#RRGGBB[AA]) или идентификатор цвета темы.","Цвет по умолчанию для тем с высоким контрастом. Укажите значение цвета в шестнадцатеричном формате (#RRGGBB[AA]) или идентификатор цвета темы.","'configuration.colors' должен быть массивом","{0} должен представлять собой значение цвета в шестнадцатеричном формате (#RRGGBB[AA] или #RGB[A]) или идентификатор цвета темы.","Параметр 'configuration.colors.id' должен быть указан и не может быть пустым","Параметр 'configuration.colors.id' должен следовать за word[.word]*","Параметр 'configuration.colors.description' должен быть указан и не может быть пустым","'configuration.colors.defaults' может быть указан и может содержать значения 'light', 'dark' и 'highContrast'"],
"vs/workbench/services/themes/common/colorThemeSchema":["Цвета и стили для маркера.","Цвет переднего плана для маркера.","Цвет фона маркера сейчас не поддерживается.","Стиль шрифта для правила: 'italic', 'bold', 'underline' или их сочетание. Если указана пустая строка, то унаследованные настройки отменяются.","Стиль шрифта может иметь значения 'italic', 'bold' и 'underline', сочетание этих свойств или содержать пустую строку.","Нет (очистить унаследованный стиль)","Описание правила.","Переключатель области, для которой проверяется это правило.","Путь к файлу tmTheme (относительно текущего файла).","Цвета для выделения синтаксических конструкций"],
"vs/workbench/services/themes/common/fileIconThemeSchema":["Значок папки для развернутых папок. Значок развернутой папки используется по желанию. Если он не задан, будет отображаться значок, заданный для папки.","Значок папки для свернутых папок, а также если не задан параметр folderExpanded для развернутых папок.","Значок файла по умолчанию, отображаемый для всех файлов, которые не соответствуют известному расширению, имени файла или коду языка.","Сопоставляет имена папок со значками. Ключ объекта — имя папки, не включая сегменты пути. Не допускается использование шаблонов или подстановочных знаков. Имена папок сопоставляются без учета регистра.","Идентификатор определения значка для сопоставления.","Сопоставляет имена папок со значками для развернутых папок. Ключ объекта — имя папки, не включая сегменты пути. Не допускается использование шаблонов или подстановочных знаков. Имена папок сопоставляются без учета регистра.","Идентификатор определения значка для сопоставления.","Сопоставляет расширения файлов со значками. Ключ объекта — имя расширения файла. Имя расширения представляет собой последний сегмент имени файла после последней точки (не включая точку). Расширения сопоставляются без учета регистра.","Идентификатор определения значка для сопоставления.","Сопоставляет имена файлов со значками. Ключ объекта — полное имя файла, не включая сегменты пути. Имя файла может содержать точки и возможное расширение файла. Не допускается использование шаблонов или подстановочных знаков. Имена файлов сопоставляются без учета регистра.","Идентификатор определения значка для сопоставления.","Сопоставляет языки и значки. Ключ объекта — идентификатор языка, как определено в точке публикации для языка.","Идентификатор определения значка для сопоставления.","Шрифты, используемые в определениях значков.","Идентификатор шрифта.","Расположения шрифта.","Путь к шрифту относительно текущего файла темы значка.","Формат шрифта.","Насыщенность шрифта.","Стиль шрифта.","Размер шрифта по умолчанию.","Описание всех значков, которые можно использовать при сопоставлении файлов и значков.","Определение значка. Ключ объекта — идентификатор определения.","При использовании SVG или PNG: путь к изображению. Путь задается относительно файла набора значков.","При использовании шрифта с глифами: используемый символ в шрифте.","При использовании шрифта с глифами: используемый цвет.","При использовании шрифта: размер шрифта в процентах от шрифта текста. Если не задан, по умолчанию используется размер в определении шрифта.","При использовании шрифта: идентификатор шрифта. Если не задан, по умолчанию используется первое определение шрифта.","Дополнительные сопоставления для значков файлов в светлых цветных темах.","Дополнительные сопоставления для значков файлов в контрастных цветных темах.","Определяет, следует ли скрыть стрелки проводника, если эта тема активна."],
